116.body:
No main.rs devemos declarar os comandos e parâmetros em um struct. Exemplo: use structopt::StructOpt; #[derive(StructOpt)]
#[structopt(name = "example", about = "Aplicação teste de command line")]
struct Args { /// Versão que deve processar versao: String, /// Arquivo para carregar arquivo: String,
} Observe que no topo do struct foi adicionado #[derive(StructOpt)] e também possui um #[structopt]. Esse último atributo permite definir o nome a e descrição para o aplicativo CLI. A definição dessa estrutura já irá montar o nosso help automaticamente, onde pode ser chamado pelo parâmetro --help. Os campos possuem comentários com ///, que já servem como help do parâmetro ou comando. Para acessarmos os parâmetros devemos fazer da seguinte forma: #[paw::main]
fn main(args: Args) { println!( "versão: {:?} arquivo: {:?}", args.versao, args.arquivo );
} Observe no main possui o atributo #[paw::main] e que recebe o parâmetro args: Args. Mas o args não é array de strings , e sim é nossa própria estrutura de parâmetros já preenchida. Se o usuário não informar os parâmetros esperados nem irá executar o método main. Isso também inclui a validação do formato do parâmetro, por exemplo, se definimos um parâmetro numérico u32 e o usuário informou String. Esses tipos de validações simplificam muito o desenvolvimento da aplicação. Nesse exemplo acima os parâmetros são posicionais , ou seja, eles dependem da ordem da posição em que foram definidos.

