Podemos criar "comandos" de forma que cada comando tenha seus próprios parâmetros. Para isso devemos que declarar um enum para conter os comando e definir o atributo #[structopt(subcommand)]: # use structopt::StructOpt; #[derive(StructOpt)]
#[structopt(name = "example", about = "An example of StructOpt usage.")]
struct Args { /// Activate debug mode, short and long flags (-d, --debug) will be deduced from the field's name #[structopt(short, long)] debug: bool, /// Version #[structopt(short, long)] version: String, #[structopt(subcommand)] command: Command,
} #[derive(StructOpt)]
enum Command { List {}, Add { /// Description (posicional field) description: String, /// Abbreviation (argumented and optional) #[structopt(short, long)] abbreviation: Option<String>, }, Done { /// Id (posicional field) id: i64, },
} No exemplo acima o nosso programa vai ter os comandos list , add e done . Observe que cada comando teu os seus próprios parâmetros. Na execução da rotina podemos fazer um match para os comandos: #[paw::main]
fn main(args: Args) { println!( "debug: {} versão: {:?}", args.debug, args.version, ); match args.command { Command::List {} => { list(); } Command::Add { description, abbreviation, } => { add(description, abbreviation); } Command::Done { id } => { done(id); } }
} Observe que os parâmetros de cada comando são "declarados" dentro do bloco do match. Assim como alguns parâmetros são exclusivos de cada comando (declarado no enum ), podemos ter parâmetros "globais" (declarados no struct )

