Eventualmente poderemos precisar acessar atributos pelo nome. Para isso podemos usar o tipo Value e a função from_str: use serde_json::Value;
use serde_json::from_str; fn main() { let data = r#" { "name": "John Doe", "age": 43, "phones": [ "+44 1234567", "+44 2345678" ] }"#; // Parse the string of data into serde_json::Value. let v: Value = from_str(&data).unwrap(); // Access parts of the data by indexing with square brackets. println!("Please call {} at the number {}", v["name"], v["phones"][0]); } Também é possível desserializar o json em map : let map = HashMap<String, Value> = from_str(&data).unwrap();
``` ## Serializando e desserializando *structs*
Para tornar um objeto serializável devemos definir os seguintes atributos no topo do `struct`: ```rust
use serde::{Deserialize, Serialize}; #[derive(Serialize, Deserialize)]
pub struct ObjetoJson { pub id: u32, pub name: String,
}
``` Para serializar objeto em *string*:
```rust let var_string = serde_json::to_string(&objeto_json).unwrap();
``` Para desserializar objeto a partir de *string*:
```rust
let objeto_json: ObjetoJson = serde_json::from_str(&var_string).unwrap();
``` Também é possível desserializar objeto usando a notação do *turbo fish* `::<>`:
```rust
let objeto_json = serde_json::from_str::<ObjetoJson>(&var_string).unwrap();
``` Exemplo completo: ```rust
use serde::{Deserialize, Serialize}; #[derive(Serialize, Deserialize, Debug)]
pub struct Groups { groups: Vec<Group>
} #[derive(Serialize, Deserialize, Debug)]
pub struct Group { pub id: u32, pub name: String,
} fn main() { // Serializar objeto em string let groups_s; { let group_a = Group { id: 1, name: String::from("Group A"), }; let group_b = Group { id: 2, name: String::from("Group B"), }; let group_c = Group { id: 3, name: String::from("Group C"), }; let groups = Groups { groups: vec![group_a, group_b, group_c] }; groups_s = serde_json::to_string(&groups).unwrap(); } // Desserializar objeto a partir de string let groups = serde_json::from_str::<Groups>(&groups_s).unwrap(); println!("{:?}", groups); }
```
### Formatação com quebra de linha
Por padrão quando fazemos uma desserialização por `serde_json::to_string` o conteúdo fica todo em uma linha.
Quando temos uma estrutura grande pode ficar difícil de ler. Para obtermos um string com quebra de linha e fácil
entendimento humana usamos o `serde_json::to_string_pretty`: ```rust
let value = json!({ "code": 200, "success": true, });
let s = serde_json::to_string_pretty(&value).unwrap();
println!("{}", s);
``` ### Ferramenta para gerar *struct* a partir de string json
Isso é útil, por exemplo, quando pretendemos interagir com alguma API com os tipos *json* já definidos. Podemos usar a ferramenta [transform.tools/json-to-rust-serde](https://transform.tools/json-to-rust-serde) Este site permite colocar o *json* e ele gera o *struct* Rust. É necessário ajustar a dependência para a versão mais recente do serde (trocar `serde_derive::` para `serde::`).
Deve ficar: ```rust
use serde::{Serialize, Deserialize}; ```
## Exercícios Pratique as três formas apresentadas para trabalhar com json: * `json!`
* `Value` + `from_str`
* `#[derive(Serialize, Deserialize)]` (`serde_json::to_string` `serde_json::from_str`) ---
Aplique a serialização de *json* para os *structs* do exercício de vendas (produto, cliente, pedido e item). ---
Vamos preparar o nosso aplicativo de vendas para ler e gravar dados. Crie objetos *ProdutoRepository*, *ClienteRepository*, etc. Esses objetos deve ter um método `load(codigo: u32)` que deve receber o código e deve retornar `Result<Cliente, String>`, por exemplo. Moque alguns registros praticando o uso do `json!`.
Dica: a rotina pode ser algo como: ```rust
if codigo == 1 { let cliente = serde_json::from_str::<Cliente>( json!( "codigo": codigo, "nome": "Nome", ) ); Ok(cliente)
} else { Err(format!("Registro de código {} não encontrado!", codigo))
}
```

