A estrutura Box serve para representar a referência a um dado de tamanho desconhecido , ou seja, que será obrigatoriamente alocado na heap . Na prática ele é mais utilizado para permitir estruturas recursivas e referências a traits (interfaces). O exemplo abaixo possui a estrutura Node que é recursiva, pois pode conter um campo opcional para representar o objeto pai, que possui mesmo tipo. Esse campo deve ser armazenado como Box<Node>: use std::path::PathBuf; #[derive(Debug, Clone)]
struct Node { path: PathBuf, parent: Option<Box<Node>>,
} impl Node { pub fn new(path: PathBuf) -> Node { Self { path, parent: None } } pub fn add_child(parent: &Node, path: PathBuf) -> Self { let parent_box = Box::new(parent.clone()); // <- Criando Box Self { path, parent: Some(parent_box), } }
} fn main() { let node_parent = Node::new(PathBuf::from("C:\\")); let node_child = Node::add_child(&node_parent, PathBuf::from("TEMP")); println!("Parent: {:?}", node_parent); println!("Child: {:?}", node_child); if let Some(parent) = node_child.parent { let n = &*parent; // <- Acessar objeto original println!("Parent: {:?}", n); }
} Observe que o objeto Node pai é clonado. Isso significa, que no exemplo acima, foram criados 3 objetos. Para estruturas pequenas isso não é problema, mas caso contrário seria interessante haver uma referência ao objeto pai. A seguir vamos ver como fazer isso.

