A estrutura Rc serve para fazer um contador de referência a um objeto, fazendo com que o objeto seja eliminado quando não houver mais referência. Essa estrutura então flexibiliza a regra do borrow checker , onde um objeto só deve ter um owner . Na prática funcionará muito semelhante a outras linguagens com GC . Na prática o Rc será o owner do objeto, então nunca acessaremos o objeto de forma owned . Por isso é interessante o construtor do objeto já retornar o Rc. Para utilizarmos o Rc cada estrutura que precisa ter uma referência dele, para isso devemos fazer clone do Rc (não do objeto). Vamos ver como fica o exemplo acima utilizando Rc: use std::{path::PathBuf, rc::Rc}; #[derive(Debug, Clone)]
struct Node { path: PathBuf, parent: Option<Rc<Node>>,
} impl Node { pub fn new(path: PathBuf) -> Rc<Node> { let node = Self { path, parent: None }; Rc::new(node) // <- Construtor criando e retornando o Rc } pub fn add_child(parent: &Rc<Node>, path: PathBuf) -> Self { let parent_rc = Rc::clone(parent); // <- Clone apenas do Rc, não do Node Self { path, parent: Some(parent_rc), } }
} fn main() { let node_parent = Node::new(PathBuf::from("C:\\")); let node_child = Node::add_child(&node_parent, PathBuf::from("TEMP")); println!("Parent: {:?}", node_parent); println!("Child: {:?}", node_child); if let Some(parent) = node_child.parent { let n = &*parent; // <- Acessar objeto original println!("Parent: {:?}", n); }
} Observe que no construtor new retorna o Rc no método add_child é feito clone do Rc. O custo desse clone é de apenas um ponteiro. Existe outro smart pointer chamado Arc, que funciona como o Rc, porém o Arc permite se acessado por threads diferentes. O Rc permite mais de uma referência do mesmo objeto, porém ele não permite mutabilidade. Para permitir isso veremos outro smart pointer a seguir.

148.body:
O RefCell permite acessar um dados de forma mutável, mesmo que ele não esteja declaro como mutável. Geralmente essa estrutura é utilizada em conjunto com o Rc , pois ele sozinho não faz reference count . Para acessar a variável de forma mutável existe o método borrow_mut. Exemplo: use std::{cell::RefCell, path::PathBuf, rc::Rc}; #[derive(Debug, Clone)]
struct Node { path: PathBuf, parent: Option<Rc<RefCell<Node>>>,
} impl Node { pub fn new(path: PathBuf) -> Rc<RefCell<Node>> { let node = Self { path, parent: None }; let node_rc = RefCell::new(node); Rc::new(node_rc) // <- Construtor criando e retornando o Rc } pub fn add_child(parent: &Rc<RefCell<Node>>, path: PathBuf) -> Self { let parent_rc = Rc::clone(parent); // <- Clone apenas do Rc, não do Node Self { path, parent: Some(parent_rc), } }
} fn main() { let node_parent = Node::new(PathBuf::from("C:\\")); let node_child = Node::add_child(&node_parent, PathBuf::from("TEMP")); println!("Parent: {:?}", node_parent); println!("Child: {:?}", node_child); // Delimita escopo da variável p { let mut p = node_parent.borrow_mut(); // <- Acessando a variável de forma mutável p.path = PathBuf::from("D:\\"); } // Conferir se alterou parent println!("Parent: {:?}", node_parent); println!("Child: {:?}", node_child);
} O borrow_mut não permite que a variável seja acessada de forma mutável mais de uma vez simultaneamente. Ou seja, ele faz uma checagem em tempo de runtime para garantir que a mesma variável não está sendo acessada de forma mutável no mesmo escopo. Se isso ocorrerá uma panic.

