Para acessar um mesmo objeto entre diferentes threads deve usar smart pointer Mutex. O Mutex possui o método lock permite criar um escopo onde somente uma thread irá acessar de cada vez. Podemos associar ao comportamento da sintaxe synchronized do Java. Este método lock retorna uma referência mutável do objeto que ele está armazenada. O Mutex sozinho não realiza reference count para permitir múltiplas referências. Para isso isso usaremos o Arc, que funciona semelhante ao Rc. Devemos colocar o Mutex dentro de um Arc, e este por sua vez deve ser clonado por Arc::clone para ser repassado para as threads . Exemplo: use std::thread;
use std::sync::{Mutex, Arc}; fn main() { // thread-safe and lockable let safe = Arc::new(Mutex::new(5)); // more than one handle // store them in a vec // for convenience let mut handles = vec![]; for i in 0..2 { // clone the transmitter let safe = Arc::clone(&safe); // create the thread let handle = thread::spawn(move|| { // lock the value let mut a = safe.lock().unwrap(); // mutate the value *a += 3; }); // push the handle into the handles // vector so we can join them handles.push(handle); } // join the handles in the vector for i in handles { i.join().unwrap(); } // lock the value when accessing it println!("a: {}", *safe.lock().unwrap());
}

