Para declarar uma trait devemos fazer semelhante como fazemos com struct: pub trait MyTrait { fn name(&self) -> String;
} Para implementação devemos ter um bloco do tipo impl Trait for Struct. Esse bloco fica fora do impl da implementação: pub struct MyStructA { name: String,
} impl MyStructA { pub fn new(name: String) -> Self { Self { name, } }
} // Implementação da trait para este struct
impl MyTrait for MyStructA { fn name(&self) -> String { self.name.clone() }
} Observe que essa distinção é bem interessante pois facilmente sabemos quais métodos estão sendo implementados por cada trait . No Java por exemplo, apenas aparece um @override. Podemos inclusive implementar em um arquivo fonte diferente de onde está declarado. Por exemplo, posso implementar MyTrait no struct String: // Implementação da trait para String
impl MyTrait for String { fn name(&self) -> String { "string name".to_string() }
}

