Um bom exemplo de uso de interface/ trait é tornar a aplicação desacoplada da implementação que obtém um valor a partir de arquivo de configuração. Vamos imaginar uma rotina que obtém o id do cliente em execução e o caminho do banco de dados. Em produção a aplicação pode usar a implementação que lê esses dados de arquivo ini, entretanto para testes unitários podemos mocar esses dados para um ambiente de desenvolvimento. Nesse exemplo vamos declarar a estrutura de configuração: struct Config { customer_id: u32, data_base_uri: String,
} Essa estrutura deve ser obtida por um provider , que pode ter diversas implementações. A trait do provider será assim: trait ConfigProvider { fn load(&self) -> Config;
} Esta trait declara o método load. Observe que ele dever ter o parâmetro &self, que indica método dinâmico. Agora vamos declarar a implementação: struct FileConfigProvider { config_file: PathBuf,
} impl FileConfigProvider { fn new(config_file: PathBuf) -> Self { Self { config_file } }
} impl ConfigProvider for FileConfigProvider { fn load(&self) -> Config { //TODO: Create Config from ini file here... Config { customer_id: 4070, data_base_uri: String::from("localhost:5020"), } }
} Observe a linha impl ConfigProvider for FileConfigProvider, é aqui que declaramos a implementação da interface. Agora vamos ver como armazenamos a variável que recebe a trait: fn main() { let config_file = PathBuf::from("APP.ini"); let config_provider: Box<dyn ConfigProvider> = Box::new(FileConfigProvider::new(config_file)); let config = config_provider.load(); println!( "Customer id: {} data base URI: {}", config.customer_id, config.data_base_uri );
} Observe que a variável config_provider é owned , ou seja, é dona do objeto. Por isso nesse caso é obrigado a usarmos o Box. Caso fosse armazenar a referência então pode usar o &dyn ConfigProvider. Por exemplo: fn main() { let config_file = PathBuf::from("APP.ini"); let config_provider: &dyn ConfigProvider = &FileConfigProvider::new(config_file); let config = config_provider.load(); println!( "Customer id: {} data base URI: {}", config.customer_id, config.data_base_uri );

