Para declarar campo contendo uma trait em geral usamos Box<T>. O exemplo mostra como receber uma trait por dyn e impl: pub struct StructTraitBoxed { data_set: Box<dyn DataSet>,
} impl StructTraitBoxed { pub fn from_impl(data_set: impl DataSet + 'static) -> Self { Self { data_set: Box::new(data_set), } } pub fn from_box(data_set: Box<dyn DataSet>) -> Self { Self { data_set } }
} Observe que usamos impl DataSet + 'static, que é uma restrição técnica para garantir que a trait não conterá nenhum referência externa com tempo de vida curta. Outra possibilidade é usar generic com bounds : pub struct StructTraitGeneric<T: DataSet> { data_set: T,
} impl<T: DataSet> StructTraitGeneric<T> { pub fn from_impl(data_set: T) -> Self { Self { data_set } } pub fn from_box(data_set: Box<T>) -> Self { Self { data_set: *data_set, } }
} Esse tipo acima deve ser evitado pois ele pode causar o efeito que a declaração da generic acaba se espalhando.

