# id: u32,
# name: String,
# }
fn main() { let user_a = User { id: 19, name: String::from("Vanius"), }; let user_b = user_a.clone(); // <= Error! println!("User a: {} {}", user_a.id, user_a.name); println!("User b: {} {}", user_b.id, user_b.name);
} Muitos dos comportamentos semânticos da linguagem são feitos através da implementação de traits (semelhante a interface) sobre tipos de estruturas. Por exemplo, para chamar o método clone o tipo deve implementar o trait Clone. Num capítulo futuro iremos falar sobre implementação de traits . A maioria dos tipos nativos do Rust já implementam o trait Clone. Para o nosso tipo User permitir clone usaremos o recurso de derive. A derive definimos acima de declarações de itens. A sintaxe é: #[derive(Aaa,Bbb,Ccc)] Para exemplificar um uso iremos usar o #[derive(Clone)]: #[derive(Clone)]
struct User { id: u32, name: String,
} A derive Clone acaba implementando de forma implícita (invisível) o trait Clone. Provavelmente ele cria algo como: fn clone(&self) -> Self { struct User { id: self.id.clone(), name: self.name.clone(), }
} É criada um novo struct fazendo clone de todos os campos. Por isso para funcionar a derive Clone todos os campos também devem implementar a trait Clone. Após isso o nosso exemplo volta a funcionar e compila corretamente: # #[derive(Clone)]
