# id: u32,
# name: String,
# }
fn main() { let user_a = User { id: 19, name: String::from("Vanius"), }; let user_b = user_a.clone(); println!("User a: {} {}", user_a.id, user_a.name); println!("User b: {} {}", user_b.id, user_b.name);
