Existem dois tipos de String: String e &str, que possuem as seguintes diferenças: String é uma string dinâmica alocada na memória heap , podendo aumentar de tamanho. &str é uma referência em algum lugar na memória ( heap ou stack ) de uma cadeia de caracteres, não pode mudar de tamanho. Também pode ser chamado de slice . Para facilitar entendimento, podemos fazer um comparativo ao Java, com os tipos String e StringBuilder. Quando declaramos uma literal é assumido o tipo &str: # fn main() {
let s = "Rech Informática";
println!("s = {}", s);
# } Vamos ver um exemplo do tipo String: # fn main() {
let s = String::from("Rech Informática");
println!("s = {}", s);
# } Nesse exemplo já vemos mais algumas características do Rust. Os dois sinais de : significa que é delimitador de uma função estática da classe. No caso from é um construtor da classe. Um ponto . significa um delimitador de método dinâmico. Podemos converter um slice String &str para String através do método to_string: # fn main() {
let hello = "Hello".to_string();
println!("hello = {}", hello);
# } Podemos converter uma String para &str, definindo o caractere & antes do String, que funciona como uma referência: # fn main() {
let s: &str = &String::from("Rech Informática");
println!("s = {}", s);
# } Por causa disso para definirmos funções geralmente utilizaremos o &str como tipo de parâmetros, por ser mais compatível e permitir literais. É natural haver uma dificuldade inicial para lidar e entender os dois tipos de String , mas como foi dito no capítulo de introdução: se compilar então você está fazendo certo, você não terá erros ou comportamentos inesperados.

