println!("Tell me about {}", number);
match number { 1 => println!("One!"), 2 | 3 | 5 | 7 | 11 => println!("This is a prime"), 13..=19 => println!("A teen"), x => println!("Ain't special: {}", x),
}
# } Assim como outras estruturas, match pode funcionar como uma expressão que retorna um valor. Isso permite construir códigos bem elegantes tal como: # fn main() {
let m = 1;
let month = match m { 1 => "jan", 2 => "feb", 3 => "mar", _ => "other", };
