println!("{}", month);
# } Nos exemplos acima cada arm retornava o valor numa única linha, porém o arm pode funcionar como um bloco através das chaves, tendo a última linha como retorno: fn main() { let m = 1; let month = match m { 1 => { println!("First month"); "jan" }, 2 => "feb", 3 => "mar", _ => "other", }; println!("{}", month);
