Vamos recapitular um conceito utilizado em muitas linguagens, que são sobre variáveis reference e variáveis value . Para entendermos ver um exemplo em Java, que estamos mais familiarizados: import java.util.ArrayList;
import java.util.List; public class MyClass { public static void main(String args[]) { int x = 10; int y = x; System.out.println("x = " + x); System.out.println("y = " + y); int y = 0; System.out.println("x = " + x); System.out.println("y = " + y); }
} Na linha int y = x ocorre a semântica copy, onde valor da variável é copiado para outra variável. Em Java variáveis primitivas não possuem referência, o sinal de atribuição sempre faz a copia o valor - cada variável aponta para um valor de área de memória diferente. Porém o exemplo abaixo ocorre algo diferente: import java.util.ArrayList;
import java.util.List; public class MyClass { public static void main(String args[]) { var l1 = new ArrayList<Integer>(List.of(0, 1, 2, 3)); var l2 = l1; System.out.println("l1 = " + l1.toString()); System.out.println("l2 = " + l2.toString()); l2.clear(); System.out.println("l1 = " + l1.toString()); System.out.println("l2 = " + l2.toString()); }
} Na linha var l2 = l1 faz que as duas varáveis referenciem o mesmo valor sem ocorrer o copy. Java permite que duas variáveis sejam donas do mesmo valor, é papel do GC ficar controlando que as duas variáveis sairão de contexto para poder dropar o valor. Observe que é comum de iniciantes da programação terem dificuldade para entender o conceito de referência, por exemplo, acharem que podemos copiar uma nova lista fazendo ArrayList l2 = l1. No Java não há nenhum alerta, mas a linha l2.clear() faz algo muito perigoso, pois a lista é inicializada enquanto existe outra variável l1 referenciando o mesmo objeto.

