let a: Option<u32> = Some(1);
let n = a.unwrap();
# } Esse método é perigoso, devemos usar somente quando termos certeza do que estamos fazendo. Se o Option possuir None irá levantar uma erro panic e interromper a execução do programa. Para retornar um default quando o valor não existe podemos usar o unwrap_or: # fn main() {
